B.KL=new A.bk("Comportamiento sexual, percepci\xf3n del riesgo y actitudes en torno a la viruela s\xedmica de personas pertenecientes a los sectores de LGTBIQ+ en Colombia.",null,B.r,B.az)
B.Kq=new A.bk("\n\nInvestigadores principales: ",null,B.r,B.cg)
B.Km=new A.bk("Zulma Milena Cucunub\xe1 Perez, C\xe1ndida Rosa D\xedaz Brochero, David Santiago Quevedo Vega.",null,B.r,B.az)
B.Ku=new A.bk("\n\n\xbfCua\u0301l es el propo\u0301sito del estudio?",null,B.r,B.cg)
B.Kw=new A.bk("\n\nEntender el impacto que tendr\xe1 la epidemia de viruela s\xedmica en las personas pertenecientes a los sectores de LGTBI+ en Colombia y de esta manera implementar medidas para su control.",null,B.r,B.az)
B.KF=new A.bk("\n\n\xbfEn que\u0301 consiste el estudio?, \xbfCua\u0301nto tiempo durara\u0301 mi participacio\u0301n en el estudio?",null,B.r,B.cg)
B.Kx=new A.bk("\n\nEste es un proyecto de investigaci\xf3n para caracterizar el comportamiento sexual, percepci\xf3n del riesgo y actitudes en torno a la infecci\xf3n por virus de viruela del mono de las personas pertenecientes a los sectores de LGTBIQ+ en Colombia.\nCada participante contestara\u0301 una sola vez, de forma voluntaria, ano\u0301nima, auto\u0301noma y completa el cuestionario virtual. Cuanto ma\u0301s sinceras sean las respuestas brindadas, mayor sera\u0301 la calidad de la informacio\u0301n que ayude a cumplir con el propo\u0301sito del estudio. La encuesta se contesta una sola vez y como parte de este estudio no se realizara\u0301 ningu\u0301n otro tipo de contacto o seguimiento.",null,B.r,B.az)
B.Ko=new A.bk("\n\n\xbfQue\u0301 beneficios tiene el estudio?",null,B.r,B.cg)
B.Kr=new A.bk("\n\nAl participar en este estudio y contestar la encuesta con sinceridad, usted contribuir\xe1 con informaci\xf3n clave que permitir\xe1 estimar el impacto de la infecci\xf3n en las personas pertenecientes a los sectores LGTBIQ+ del pa\xeds que sirva de base para la planeaci\xf3n de medidas de control de la viruela s\xedmica.",null,B.r,B.az)
B.KP=new A.bk("\n\n\xbfHay algunos riesgos como consecuencia de responder la encuesta?",null,B.r,B.cg)
B.KN=new A.bk("\n\nNo hay riesgos fi\u0301sicos, sociales o econo\u0301micos asociados con la participacio\u0301n en este estudio. Hay algunas preguntas que podri\u0301a encontrar inco\u0301modas o difi\u0301ciles de responder, sin embargo, no esta\u0301 obligado (a) de ninguna forma a responderlas todas. As\xed mismo, si despue\u0301s de iniciada la encuesta no se siente co\u0301modo (a) con las preguntas o con la informacio\u0301n que se solicita, usted podra\u0301 dejar de contestar.",null,B.r,B.az)
B.Kv=new A.bk("\n\n\xbfCo\u0301mo se protegera\u0301 su privacidad?",null,B.r,B.cg)
B.KO=new A.bk("\n\nEste proyecto se acoge a la ley 1581 de 2012 (Ha\u0301beas Data) que aplica para el tratamiento de datos personales. Entendemos que la informacio\u0301n solicitada puede ser delicada y privada, por ello desde la planeacio\u0301n del estudio se han disen\u0303ado las siguientes estrategias para asegurar la confidencialidad de la informacio\u0301n:\n\n1) No le sera\u0301n solicitados datos de identificacio\u0301n como: nombres, apellidos, nu\u0301mero de ce\u0301dula u otros.\n\n2) La encuesta so\u0301lo se puede contestar de forma virtual por medio de una herramienta electro\u0301nica (celular, tableta, computador, porta\u0301til), de esta manera usted no tendra\u0301 que compartir informacio\u0301n personal de cara\u0301cter privado con un entrevistador.\n\n3) No quedara\u0301 ningu\u0301n registro del dispositivo electro\u0301nico que se use para contestar la encuesta (nu\u0301mero de celular, registro o direccio\u0301n IP, etc.).\n\n4) Toda la informacio\u0301n recolectada sera\u0301 enviada directamente a una plataforma a la que solo tienen acceso los (las) investigadores(as) del proyecto.\n\n5) Los resultados de la investigacio\u0301n sera\u0301n publicados siempre de forma agrupada, de tal manera que usted nunca ser\xe1 identificado.\n\nEste estudio ha sido revisado y aprobado por el Comite\u0301 de E\u0301tica de Investigacio\u0301n de la Pontificia Universidad Javeriana / HUSI. Si tiene preguntas adicionales puede contactarse con la investigadora principal Candida Diaz Brochero al correo candida_diaz@javeriana.edu.co.\n\nPresidente del Comite\u0301 de E\u0301tica Institucional: Carlos Go\u0301mez-Restrepo, Tele\u0301fono 3208320 ext 2770, Direccio\u0301n cra. 7 N\xb0 40-62. Facultad de Medicina.\n\n",null,B.r,B.az)
